import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {BrowserRouter} from 'react-router-dom';


ReactDOM.render(
  <>
    <BrowserRouter style={{background:"red"}}>
      <App/>
    </BrowserRouter>
  </>,
  document.getElementById("root")
);
